import {Routes,Route} from "react-router-dom"
import Login from "./Login";
import Profile from "./Profile";
import Launchweb from "./Launchweb";
import Register from "./Register";
import { initializeApp } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-app.js";

const firebaseConfig = {
    apiKey: "AIzaSyB1n5GjyWpRr4sC3mo9AjL0SkOH3KC5ZVI",
    authDomain: "basic-web-2b71e.firebaseapp.com",
    projectId: "basic-web-2b71e",
    storageBucket: "basic-web-2b71e.appspot.com",
    messagingSenderId: "60043802817",
    appId: "1:60043802817:web:f0a59ba7d8b09c0d09bc40",
    measurementId: "G-HGEGEPC72G"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const form =document.getElementById("registerForm")
const formarea = document.getElementById("form-area")
form.addEventListener("submit",(e)=>{
  e.preventDefault()
  console.log(form.email.value)
  console.log(formarea.password.value)
})

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Login/>}/>
        <Route path="Login" element={<Login/>}/>
        <Route path="Profile" element={<Profile/>}/>
        <Route path="Launchweb" element={<Launchweb/>}/>
        <Route path="Register" element={<Register/>}/>
      </Routes> 
    </div>
  );
}

export default App;
